-- VERIFICATION QUERIES
-- ============================================
SELECT 'Total Books' as check_item, COUNT(*) as count FROM "Library_librarybook"
UNION ALL
SELECT 'Total Barcodes', COUNT(*) FROM "Library_librarybooksbarcode"
UNION ALL
SELECT 'Available Books', COUNT(*) FROM "Library_librarybook" WHERE book_status = 'AVAILABLE';

-- Books by Category
SELECT 
    bc.category_name,
    COUNT(lb.id) as book_count
FROM "Library_bookcategory" bc
LEFT JOIN "Library_librarybook" lb ON bc.id = lb.book_category_id
GROUP BY bc.category_name
ORDER BY bc.category_name;